	render() {
		if(this.props.isSignedIn == true) {
			return (
				<ChannelList />
			);
		}
		else {
			return (
				<div className="right">	

				</div>
			);
		}
	}
}

const mapStateToProps = (state) => {
	return {
		isSignedIn: state.auth.isSignedIn
